import React from "react";
import styles from "./users.module.css";


let Users = (props) => {
    return (
        <div>
            <div>
                {pages.map(el => {
                    return <span className={this.props.currentPage === el && styles.selectedPage} onClick={(e) => {
                        this.onPageChanged(el);
                    }}>{el}</span>
                })}
            </div>

            {
                this.props.users.map(el => <div key={el.id}>
                <span>
                    <div>
                        <img src={el.photos.small != null ? el.photos.small : 'nagievjpg.jpg'} alt=""
                             className={styles.userPhoto}/>
                    </div>
                    <div>
                        {el.followed ? <button onClick={() => {
                            this.props.unfollowAC(el.id)
                        }}>Followed</button> : <button onClick={() => {
                            this.props.followAC(el.id)
                        }}>Unfollwed</button>}
                    </div>
                </span>
                        <span>
                    <span>
                        <div>{el.name}</div>
                        <div>{el.status}</div>
                        </span><span>
                        <div>{"el.location.city"}</div>
                        <div>{"el.location.country"}</div>
                        </span>
                </span>
                    </div>
                )
            }
        </div>
    )
}
export default Users
